import React, { useState, useEffect } from "react";
import "./App.css";
import HideAppBar from "./components/AppBar";
import RecipeReviewCard from "./components/CityCard";
import axios from "axios";


function App() {

  const [posts, setPosts] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios(
        "http://api.openweathermap.org/data/2.5/forecast?id=524901&APPID=62029f0d3701271a5e50142b280915f0"
      );
      setPosts(result.data);
    };
    fetchData();
  }, []);


  return (
    <div className="App">
      <header className="App-header">
        <HideAppBar />
        {posts.map((item) => (
          <div key={item.id}>{item.list};</div>
        ))}
      </header>
    </div>
  );
}

export default App;

